import React, {useEffect, useState} from "react";
import logo from './logo.svg';
import {useLocation} from "react-router-dom";

export default function (props) {
    const [currentUserName, setCurrentUserName] = useState("default");
    const [currentUserUID, setCurrentUserUID] = useState("default");
    const [currentUserPassword, setCurrentUserPassword] = useState("default");
    const location = useLocation();
    const {data} = location.state;
    setCurrentUserUID(data['UID'])
    setCurrentUserName(data['Username'])
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo"/>
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
                <p>{currentUserName}</p>
                <p>{currentUserUID}</p>
            </header>
        </div>
    )
}
